metadata.description:
the year is 2308, the planet is no longer as we know it.
future bastards are the remnants of humanity.

//over 100 different traits divided into 12 categories

Inspired by Texas landscapes. Especially, the ones that I see when driving between Houston and Austin.

// Features
Palettes: Lush Day, Autumn Day, Autumn Night, Lush Night.
Scenes: 1, 2, 3, 4, 5, 6.

// Animation
The render animation goes through 3 levels. Total render time can be a minute or two. You'll know it's done when you see leaves.

// Saving Images
Default resolution is 4096x2048, but for other resolutions execute the function RUN(pixWidth) from your browser's console. Example: RUN(8192) will re-generate the iteration with resolution 8192x4096 pixels. Then, you can save via right click.
